# 152. 乘积最大子序列
#
# 给定一个整数数组 nums ，找出一个序列中乘积最大的连续子序列（该序列至少包含一个数）。
#
# 示例 1:
# 输入: [2,3,-2,4]
# 输出: 6
# 解释: 子数组 [2,3] 有最大乘积 6。
#
# 示例 2:
# 输入: [-2,0,-1]
# 输出: 0
# 解释: 结果不能为 2, 因为 [-2,-1] 不是子数组。

# 来源：力扣（LeetCode）
# 链接：https://leetcode-cn.com/problems/maximum-product-subarray/




class Solution:
    def maxProduct1(self, nums) -> int:
        lst = [[] for _ in range(len(nums))]
        max_result = []

        for i in range(len(nums)):
            for j in range(len(nums)):
                if j < i:
                    continue
                elif i == j:
                    lst[i].append(nums[i])
                else:
                    lst[i].append(lst[i][-1] * nums[j])
            max_result.append(max(lst[i]))

        return max(max_result)

    def maxProduct(self, nums) -> int:
        if not nums: return None

        imax, imin = nums[0], nums[0]
        result = nums[0]

        for i in range(1, len(nums)):
            num = nums[i]
            imax, imin = imax * num, imin * num

            imax, imin = max(imax, imin, num), min(imax, imin, num)
            result = max(imax, result)
        return result




